#Use item (inventory function)
def useitem():
    key = input()
    global equippeditem
    global equippedarmour
    global armour
    global health
    
    if key == "sword":
        print("data:image/png;base64,")
        print("Option:\n")
        key = input()
        if key == "equip":
            equippeditem = "Sword"
            print("You equipped a sword\n")
            newroom()
        elif key == "use":
            print("You cant use this\n")
            newroom()
        elif key == "drop":
            inventoryTable.remove("Sword")
            print("You dropped a sword\n")
            if equippeditem == "Sword":
                equippeditem = 0
            newroom()
        
    elif key == "health potion":
        print("data:image/png;base64,")
        print("Option:\n")
        key = input()
        if key == "equip":
            print("You cant equip this\n")
            newroom()
        elif key == "use":
            print("You drank a health potion\n")
            health = health + 10
            print("Current hp:", health,"\n")
            inventoryTable.remove("Health Potion")
            newroom()
        elif key == "drop":
            print("You dropped a health potion\n")
            inventoryTable.remove("Health Potion")
            newroom()
            
    elif key == "iron chest piece":
        print("data:image/png;base64,")
        print("Option:\n")
        key = input()
        if key == "equip":
            armour = armour + 5
            print("You equipped an iron chest piece\n")
            equippedarmour = "Iron Chest Piece"
            print("Current armour:", armour,"\n")
            inventoryTable.remove("Iron Chest Piece")
            newroom()
        elif key == "use":
            print("You cant use this\n")
            newroom()
        elif key == "drop":
            print("You dropped a iron chest piece\n")
            inventoryTable.remove("Iron Chest Piece")
            if equippedarmour == "Iron Chest Piece":
                equippedarmour = 0
            newroom()
    elif key == "gold":
        print("data:image/png;base64,")
        print("Option:\n")
        key = input()
        if key == "equip":
            print("You cant equip this\n")
            newroom()
        elif key == "use":
            print("You are not near a shop you fucker\n")
            newroom()
        elif key == "drop":
            print("You dropped gold\n")
            inventoryTable.remove("Gold")
            newroom()
    else:
        "thats not a valid input you reatard\n"
        newroom()
    

