# new room function (key press input thing)
def newroom():
    key = input()
    var1 = 1
    action = 1
    global looted
    global monster
    monster = monsterTable[random.randrange(0, 6)]
    
    
    
    

    if key == "p":
        print("debugged")
        combat()
        newroom()
    elif key == "s":
        if looted == 0:
            founditem = lootTable[random.randrange(0, 7)]
            #print(founditem)
            print("You search the room and find a",founditem,"\n")
            action = 0
            looted = 1
            if not founditem == "Nothing":
                inventoryTable.append(founditem)
            newroom()
        else:
            print("You already looted this\n")
            newroom()
